import React from 'react'

const ImagaList = ({images}) => {
    const preperadImages=images.map((image,key)=>{
        return(
            <img src={image.urls.regular} alt="photo" />
        )
    })
  return (
    <div>
      {console.log(images)}
      {preperadImages}
    </div>
  )
}

export default ImagaList
